import React, { useEffect, useState } from 'react';
import { View, Text, FlatList, Image, StyleSheet, TouchableOpacity, ImageBackground, ScrollView, Modal } from 'react-native';
import CheckBox from '@react-native-community/checkbox';
import { useNavigation } from '@react-navigation/native';
import { StackNavigationProp } from '@react-navigation/stack';
import { NavigationProp } from '@react-navigation/native';
import { LogBox } from 'react-native';

LogBox.ignoreLogs([
    'VirtualizedLists should never be nested inside plain ScrollViews',
    'Got a component with the name cart for the screen cart.',
])

interface NavItemProps {
    title: string;
    icon: any;
}

interface TicketOption {
    id: string;
    title: string;
    price: number;
    details: string;
    image: string;
}


interface AttractionItem {
    id: string;
    image: string;
    desc: string;
    title: string;
    rating: number;
    booked: string;
    price: string;
    location: string;
    ticketOption: TicketOption[];
    date: string;
}


interface ThingsToDoItem {
    id: string;
    title: string;
    rating: number;
    booked: string;
    price: string;
    location: string;
    desc: string;
    image: string;
    ticketOption: TicketOption[];
    date: string;
}

interface PriceFilterModalProps {
    visible: boolean;
    onClose: () => void;
    onApply: (selectedRanges: Record<string, boolean>, selectedLocations: string[], selectedMonths: string[]) => void;
}

export type RootStackParamList = {
    ThingsToDo: undefined;
    ItemDetails: { item: ThingsToDoItem };
    Attraction: undefined;
    AttractionDetails: { item: AttractionItem };
    Cart: undefined;
    Home: undefined;
    BookingPage: { bookItem: BookItem };
    PackageOption: { item: ThingsToDoItem };
    PaymentPage: { bookingDetails: BookingDetails | null };
    BookingHistory: { bookingHistory: BookingDetails[] };
    PaymentSuccess: undefined;
    EventPage: undefined;
    ReviewsScreen: { item: AttractionItem };
    AccountScreen: undefined;
    FoodDining: undefined;
};


interface BookingDetails {
    firstName: string;
    lastName: string;
    myKad: string;
    email: string;
    contact: string;
    subtotal: number;
    ticket: BookItem;
}

interface TicketOption {
    id: string;
    title: string;
    price: number;
    image: string;
}

interface Traveler {
    type: 'adult' | 'senior' | 'child' | 'infant';
    count: number;
}

interface BookItem {
    id: string;
    image: string;
    name: string;
    option: TicketOption | null;
    date: string;
    time: string;
    quantity: number;
    travelers: Traveler[];
}

type ThingsToDoScreenNavigationProp = StackNavigationProp<RootStackParamList, 'AttractionDetails'>;

type Props = {
    navigation: ThingsToDoScreenNavigationProp;
};

type PriceRangeKey = 'range1' | 'range2' | 'range3' | 'range4' | 'range5';


interface PriceFilterModalProps {
    visible: boolean;
    onClose: () => void;
    onApply: (selectedRanges: Record<string, boolean>, selectedLocations: string[], selectedMonths: string[]) => void;
    checkedRanges: Record<PriceRangeKey, boolean>;
    setCheckedRanges: React.Dispatch<React.SetStateAction<Record<PriceRangeKey, boolean>>>;
    selectedLocations: string[];
    setSelectedLocations: React.Dispatch<React.SetStateAction<string[]>>;
    selectedMonths: string[];
    setSelectedMonths: React.Dispatch<React.SetStateAction<string[]>>;
}

const Attraction = () => {
    const [modalVisible, setModalVisible] = useState(false);
    const [filteredItems, setFilteredItems] = useState<any[]>([]);
    const [items, setItems] = useState<AttractionItem[]>([]);
    const navigation = useNavigation<NavigationProp<RootStackParamList>>();
    const [checkedRanges, setCheckedRanges] = useState<Record<PriceRangeKey, boolean>>({
        range1: false,
        range2: false,
        range3: false,
        range4: false,
        range5: false,
    });
    const [selectedLocations, setSelectedLocations] = useState<string[]>([]);
    const [selectedMonths, setSelectedMonths] = useState<string[]>([]);

    useEffect(() => {
        const initialItems: AttractionItem[] = [
            {
                id: '1',
                date: '',
                title: 'Penang 3D Trick Art Museum Ticket',
                rating: 3.5,
                desc: 'Trick and be tricked with more than 40 optical illusion paintings and sculptures',
                booked: ' 3K+',
                price: 'From RM 15.20',
                location: 'Georgetown',
                image: 'https://image.kkday.com/v2/image/get/w_960%2Cc_fit%2Cq_55%2Ct_webp/s1.kkday.com/product_33217/20210825085605_hS5ki/jpg',
                ticketOption: [
                    { id: '1', title: 'Malaysian Citizens', price: 15, details: 'Validity Period \n\n The voucher must be used on the selected date and within operating hours; Invalid after expiration', image: 'https://image.kkday.com/v2/image/get/w_960%2Cc_fit%2Cq_55%2Ct_webp/s1.kkday.com/product_33217/20210825085605_hS5ki/jpg' },
                ],
            },
            {
                id: '2',
                date: '',
                title: 'Tech Dome Penang',
                rating: 4.6,
                desc: 'Tech Dome Penang is a place for kids to learn more about technology',
                booked: '6K+',
                price: 'From RM 15.00',
                location: 'Georgetown',
                image: 'data:image/jpeg;base64,',
                ticketOption: [
                    { id: '1', title: 'Admission Ticket', price: 26.5, details: 'What\'s included\n\n AAdmission to: Tech Dome', image: 'data:image/jpeg;base64,', },
                ],
            },
            {
                id: '3',
                date: '',
                title: 'ESCAPE Penang Ticket',
                rating: 4.5,
                desc: 'ESCAPE Penang is a must-visit destination with family and friends when you are in Penang!',
                booked: '2K+',
                price: 'From RM 180.00',
                location: 'Tanjung Bungah',
                image: 'data:image/jpeg;base64,',
                ticketOption: [
                    { id: '1', title: 'Admission Ticket', price: 179.50, details: 'What\'s included\n\nAdmission to attractions', image: 'data:image/jpeg;base64,', },
                ],
            },
            {
                id: '4',
                date: '',
                title: 'Penang Hill Tram Ticket',
                rating: 3.7,
                desc: 'In essence, Penang Hill is a collection of peaks on the island state of Pinang but the Western Hill was most significant for having the highest point at 833 meters; which also means it is the best spot to build a railway up to the peak.',
                booked: '3K+',
                price: 'From RM 12',
                location: 'Ayer Itam',
                image: 'data:image/jpeg;base64,',
                ticketOption: [
                    { id: '1', title: '[Malaysian] Return (Normal Lane)', price: 12, details: 'Return ticket, queuing on the normal lane. The tram is a free-standing train. Seats are reserved for pregnant women, senior citizens, parents with infants and disabled people\n\n What\'s included\n\n - Wheelchair service\n - Penang Hill Visitor Guide [Brochure] \n\n Not Included \n\n -Food & Drinks \n -Entrance fee to Habitat, Little Village, Typhoon, Post Office, Owl Museum \n -Hotel buggy service \n -Hotel drop-off and/or drop-off', image: 'data:image/jpeg;base64,' },
                    { id: '2', title: '[Non-Malaysian] Return (Normal Lane)', price: 12, details: 'Return ticket, queuing on the normal lane. The tram is a free-standing train. Seats are reserved for pregnant women, senior citizens, parents with infants and disabled people\n\n What\'s included\n\n - Wheelchair service\n - Penang Hill Visitor Guide [Brochure] \n\n Not Included \n\n -Food & Drinks \n -Entrance fee to Habitat, Little Village, Typhoon, Post Office, Owl Museum \n -Hotel buggy service \n -Hotel drop-off and/or drop-off', image: 'data:image/jpeg;base64,', },
                    { id: '3', title: '[Malaysian] Return (Fast Lane)', price: 15, details: 'Return ticket, queuing on the normal lane. The tram is a free-standing train. Seats are reserved for pregnant women, senior citizens, parents with infants and disabled people\n\n What\'s included\n\n - Wheelchair service\n - Penang Hill Visitor Guide [Brochure] \n\n Not Included \n\n -Food & Drinks \n -Entrance fee to Habitat, Little Village, Typhoon, Post Office, Owl Museum \n -Hotel buggy service \n -Hotel drop-off and/or drop-off', image: 'data:image/jpeg;base64,', },
                    { id: '4', title: '[Non-Malaysian] Return (Fast Lane)', price: 15, details: 'Return ticket, queuing on the normal lane. The tram is a free-standing train. Seats are reserved for pregnant women, senior citizens, parents with infants and disabled people\n\n What\'s included\n\n - Wheelchair service\n - Penang Hill Visitor Guide [Brochure] \n\n Not Included \n\n -Food & Drinks \n -Entrance fee to Habitat, Little Village, Typhoon, Post Office, Owl Museum \n -Hotel buggy service \n -Hotel drop-off and/or drop-off', image: 'data:image/jpeg;base64,', },

                ],
            },
        ];
        setItems(initialItems);
        setFilteredItems(initialItems);
    }, []);

    const renderItem = ({ item }: { item: AttractionItem }) => (
        <TouchableOpacity onPress={() => navigation.navigate('AttractionDetails', { item })}>
            <View style={styles.card}>
                <Image source={{ uri: item.image }} style={styles.image} />
                <View style={styles.cardContent}>
                    <Text style={styles.cardTitle}>{item.title}</Text>
                    <Text style={styles.rating}>★ {item.rating} • {item.booked} booked</Text>
                    <Text style={styles.price}>{item.price}</Text>
                    <Text style={styles.location}>{item.location}</Text>
                </View>
            </View>
        </TouchableOpacity>
    );

    const toggleModal = () => {
        setModalVisible((prev) => !prev);
    };

    const getMonthFromDateString = (dateString: string): string => {
        const [day, month, year] = dateString.split(' ');
        const monthMapping: { [key: string]: number } = {
            January: 0,
            February: 1,
            March: 2,
            April: 3,
            May: 4,
            June: 5,
            July: 6,
            August: 7,
            September: 8,
            October: 9,
            November: 10,
            December: 11,
        };

        const date = new Date(Number(year), monthMapping[month], Number(day));

        return date.toLocaleString('default', { month: 'long' });
    };

    const applyPriceFilter = (
        selectedRanges: Record<string, boolean>,
        selectedLocations: string[],
        selectedMonths: string[]
    ) => {
        const noRangesSelected = Object.values(selectedRanges).every(value => !value);
        const noLocationsSelected = selectedLocations.length === 0;
        const noMonthsSelected = selectedMonths.length === 0;

        if (noRangesSelected && noLocationsSelected && noMonthsSelected) {
            console.log('No filters applied. Displaying all items.');
            setFilteredItems(items);
            setModalVisible(false);
            return;
        }

        const filtered = items.filter((item) => {
            const priceValue = item.price === 'Free' ? 0 : parseFloat(item.price.replace(/[^0-9.-]+/g, ''));

            const noRangesSelected = Object.values(selectedRanges).every(value => !value);
            const priceMatch = noRangesSelected || (
                (selectedRanges.range1 && priceValue >= 0 && priceValue <= 20) ||
                (selectedRanges.range2 && priceValue > 20 && priceValue <= 40) ||
                (selectedRanges.range3 && priceValue > 40 && priceValue <= 60) ||
                (selectedRanges.range4 && priceValue > 60 && priceValue <= 80) ||
                (selectedRanges.range5 && priceValue > 80)
            );

            const locationMatch = noLocationsSelected || selectedLocations.includes(item.location);

            const itemMonth = getMonthFromDateString(item.date);
            const monthMatch = noMonthsSelected || selectedMonths.includes(itemMonth);

            console.log(`Item: ${item.price || item.date || item.location}`);
            console.log(`Price Value: ${priceValue}`);
            console.log(`Price Match: ${priceMatch}`);
            console.log(`Location Match: ${locationMatch}`);
            console.log(`Month Match: ${monthMatch}`);

            return priceMatch && locationMatch && monthMatch;
        });



        console.log('Filtered items:', filtered);
        setFilteredItems(filtered);
        setModalVisible(false);
    };

    const PriceFilterModal: React.FC<PriceFilterModalProps> = ({
        visible,
        onClose,
        onApply,
        checkedRanges,
        setCheckedRanges,
        selectedLocations,
        setSelectedLocations,
        selectedMonths,
        setSelectedMonths,
    }) => {
        const locations = ['Georgetown', 'Ayer Itam', 'Bayan Lepas', 'Jelutong', 'Tanjung Bungah', 'Batu Ferringhi'];

        const handleCheckboxChange = (range: PriceRangeKey) => {
            setCheckedRanges((prev) => ({
                ...prev,
                [range]: !prev[range],
            }));
        };

        const toggleLocationSelection = (location: string) => {
            setSelectedLocations((prev) =>
                prev.includes(location) ? prev.filter((loc) => loc !== location) : [...prev, location]
            );
        };

        const months = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'];

        const toggleMonthSelection = (month: string) => {
            setSelectedMonths((prev) =>
                prev.includes(month) ? prev.filter(m => m !== month) : [...prev, month]
            );
        };

        const handleReset = () => {
            setCheckedRanges({
                range1: false,
                range2: false,
                range3: false,
                range4: false,
                range5: false,
            });
            setSelectedLocations([]);
            setSelectedMonths([]);
        };

        const handleApply = () => {
            console.log('Selected Ranges:', checkedRanges);
            console.log('Selected Locations:', selectedLocations);
            console.log('Selected Months:', selectedMonths);
            onApply(checkedRanges, selectedLocations, selectedMonths);
        };

        return (
            <Modal
                animationType="slide"
                transparent={true}
                visible={visible}
                onRequestClose={onClose}
            >
                <ScrollView
                    style={styles.scrollView}
                    keyboardShouldPersistTaps="handled"
                >
                    <View style={styles.modalContainer}>
                        <View style={styles.modalContent}>
                            <TouchableOpacity onPress={onClose}>
                                <Image source={require('../image/close.png')} style={styles.iconClose} />
                            </TouchableOpacity>

                            <View style={{ flexDirection: 'row', alignItems: 'flex-end', justifyContent: 'space-between' }}>
                                <TouchableOpacity onPress={handleApply} style={styles.applyButton}>
                                    <Text style={styles.applyButtonText}>Apply</Text>
                                </TouchableOpacity>

                                <TouchableOpacity onPress={handleReset} style={styles.resetButton}>
                                    <Text style={styles.resetButtonText}>Reset Filters</Text>
                                </TouchableOpacity>
                            </View>
                            <Text style={styles.modalTitle}>Locations</Text>
                            {locations.map((location) => (
                                <View key={location} style={styles.checkboxItem}>
                                    <CheckBox
                                        value={selectedLocations.includes(location)}
                                        onValueChange={() => toggleLocationSelection(location)}
                                    />
                                    <Text>{location}</Text>
                                </View>
                            ))}

                            <Text style={styles.modalTitle}>Price Range</Text>
                            <View style={styles.checkboxContainer}>
                                {Object.keys(checkedRanges).map((range, index) => (
                                    <View key={index} style={styles.checkboxItem}>
                                        <CheckBox
                                            value={checkedRanges[range as PriceRangeKey]}
                                            onValueChange={() => handleCheckboxChange(range as PriceRangeKey)}
                                        />
                                        <Text>{`RM ${index * 20} - RM ${index * 20 + 20}`}</Text>
                                    </View>
                                ))}
                            </View>

                            <Text style={styles.modalTitle}>Month</Text>
                            <View style={styles.checkboxContainer}>
                                {months.map((month) => (
                                    <View key={month} style={styles.checkboxItem}>
                                        <CheckBox
                                            value={selectedMonths.includes(month)}
                                            onValueChange={() => toggleMonthSelection(month)}
                                        />
                                        <Text style={styles.checkboxLabel}>{month}</Text>
                                    </View>
                                ))}
                            </View>
                        </View>
                    </View>
                </ScrollView>
            </Modal>
        );
    };


    return (
        <ImageBackground source={require('../image/background.png')} style={styles.backgroundImage}>
            <ScrollView
                style={styles.scrollView}
                contentContainerStyle={styles.contentContainer}
                keyboardShouldPersistTaps="handled"
            >
                <View style={styles.container}>
                    {/* Header */}
                    <View style={styles.header}>
                        <TouchableOpacity style={styles.iconButton} onPress={() => navigation.navigate('Home')}>
                            <Image source={require('../image/back-icon.png')} />
                        </TouchableOpacity>
                        <Text style={styles.title}>Attraction</Text>
                        <View style={styles.headerIcons}>
                            <TouchableOpacity style={styles.iconButton} onPress={() => navigation.navigate('Cart')}>
                                <Image source={require('../image/Shopping-cart.png')} />
                            </TouchableOpacity>
                        </View>
                    </View>

                    <View style={styles.filterIcon}>
                        <TouchableOpacity style={styles.iconButton} onPress={toggleModal}>
                            <NavItem title="" icon={require('../image/filter.png')} />
                            <Text style={styles.filterText}>Filter</Text>
                        </TouchableOpacity>
                    </View>

                    <PriceFilterModal
                        visible={modalVisible}
                        onClose={toggleModal}
                        onApply={applyPriceFilter}
                        checkedRanges={checkedRanges}
                        setCheckedRanges={setCheckedRanges}
                        selectedLocations={selectedLocations}
                        setSelectedLocations={setSelectedLocations}
                        selectedMonths={selectedMonths}
                        setSelectedMonths={setSelectedMonths}
                    />

                    <View style={{ flex: 1 }}>
                        <FlatList
                            data={filteredItems}
                            keyExtractor={(item) => item.id}
                            renderItem={renderItem}
                        />
                    </View>
                </View>
            </ScrollView>
            <View style={styles.bottomNav}>

                <TouchableOpacity style={styles.iconButton} onPress={() => navigation.navigate('Home')}>
                    <View style={{ alignItems: 'center', marginBottom: 5, }}>
                        <Image source={require('../image/home-icon.png')} style={styles.iconImage} />
                        <Text style={styles.homeNav}>Home</Text>
                    </View>
                </TouchableOpacity>

                <TouchableOpacity style={styles.iconButton} onPress={() => navigation.navigate('BookingHistory', { bookingHistory: [] })}>
                    <View style={{ alignItems: 'center', marginBottom: 5 }}>
                        <Image source={require('../image/trips-icon.png')} style={styles.iconImage} />
                        <Text style={styles.homeNav}>Trips</Text>
                    </View>
                </TouchableOpacity>


                <TouchableOpacity style={styles.iconButton} onPress={() => navigation.navigate('AccountScreen')}>
                    <View style={{ alignItems: 'center', marginBottom: 5, }}>
                        <Image source={require('../image/account-icon.png')} style={styles.iconImage} />
                        <Text style={styles.homeNav}>Account</Text>
                    </View>
                </TouchableOpacity>
            </View>
        </ImageBackground>
    );
};

const NavItem: React.FC<NavItemProps> = ({ title, icon }) => {
    return (
        <TouchableOpacity style={styles.navItem}>
            <Image source={icon} style={styles.navIcon} />
            <Text style={styles.navText}>{title}</Text>
        </TouchableOpacity>
    );
};

